declare 
  v_tam number;
begin 

  p_carga_contenido(1, 1, 'contenido-cancion1.mp3');

  select dbms_lob.getlength(contenido) into v_tam
  from contenido
  where seccion_id = 1;

  if  v_tam > 0 then 
    dbms_output.put_line('Carga Exitosa.');
  else 
    raise_application_error(-20002,
      ' ERROR: No se realizó la actualización');
  end if;

  commit;
end;
/

